const Producto = function () {
	return(
		<section class="producto">
			<img src="asd" />
			<p>Nombre</p>
		</section>
	)
};

function Grilla() {
	return (
		<section id="grilla">
			<Producto />
		</section>
	)
}
export default Grilla;
